const CREATE_NEW_USER = "CREATE_NEW_USER"
export const addToCart = (pin,email,gender,firsName,lastName) => {
  return {
    type: CREATE_NEW_USER,
    payload: {pin,email,gender,firsName,lastName}
  }
}
